#include <iostream>
#include "Teltonica.h"

using namespace std;

int f(char c){
    if (c>='0' && c<='9'){
        return int(c-'0');
    }
    else return int(c-'A')+10;
}

int main(){
    string s1="";
    string s;
    //convert
    int a,b;
    for (int i=0; i<s1.size();i++){
        a=f(s1[i++])*16;
        b=f(s1[i]);
        s.push_back(a+b);
    }
    //convert
//    for (auto c:s){
//        cout<<int(c)<<' ';
//    }
    Teltonica t;
    //cout<<t.str_to_int(s);
    string tmp;
    auto res=t.parse(s);
    for (auto &it:res){
        cout<<"************\n";
        for (auto & it2:it) {
            cout << it2.first << "---" << it2.second << "\n";
        }
    }
    return 0;
}
